import { Product } from "../types";

interface ProductDetail {
  productInfo: Product[];
}

function ProductDetails(props: ProductDetail) {
  const products = props.productInfo;

  return (
    <>
      <div>{products.title}</div>
    </>
  );
}

export default ProductDetails;
